import React from "react";
import {useEffect,useState} from "react";

function Rankings(){

    const [batsman1,setbatsman1] = useState([])
    const [batsman2,setbatsman2] = useState([])
    const [batsman3,setbatsman3] = useState([])
    const [bowler,setbowler] = useState([])
    const [allrounder,setallrounder] = useState([])
    const [teams,setteams] = useState([])
    const [loading1,setLoading1] = useState([])
    const [loading2,setLoading2] = useState([])
    const [loading3,setLoading3] = useState([])

    useEffect(() => {
        
        setLoading1(true);
        setLoading2(true);
        setLoading3(true);
        const options = {
            method: 'GET',
            headers: {
                'X-RapidAPI-Key': '27acb5ed23msh42d806119019ef1p17d5c9jsn7adca89b6e0f',
		        'X-RapidAPI-Host': 'cricbuzz-cricket.p.rapidapi.com'
            }
              
        };
  
        fetch('https://cricbuzz-cricket.p.rapidapi.com/stats/v1/rankings/batsmen?formatType=test', options)
        .then((res) => res.json())
        .then((data) => {
            setbatsman1(data);
        })
        .catch((err) => {
            console.log(err);
        })
        .finally(() => {
            setLoading1(false);
        });

        fetch('https://cricbuzz-cricket.p.rapidapi.com/stats/v1/rankings/batsmen?formatType=odi', options)
        .then((res) => res.json())
        .then((data) => {
            setbatsman2(data);
        })
        .catch((err) => {
            console.log(err);
        })
        .finally(() => {
            setLoading2(false);
        });

        fetch('https://cricbuzz-cricket.p.rapidapi.com/stats/v1/rankings/batsmen?formatType=t20', options)
        .then((res) => res.json())
        .then((data) => {
            setbatsman3(data);
        })
        .catch((err) => {
            console.log(err);
        })
        .finally(() => {
            setLoading3(false);
        });

    },[])

    console.log(batsman1.rank);


    return(
        <div className="">
            <div className="bg-gray-700 ml-auto mr-auto w-fit basis-1/4 grow-0 shrink-0 flex text-white mt-8 shadow-xl  text-2xl">
                <button className="p-8 border border-white ml-auto">Batsman</button>
                <button className="p-8 border border-white">Bowler</button>
                <button className="p-8 border border-white">Allrounder</button>
                <button className="p-8 mr-auto border border-white">Team</button>
            </div>

            {!loading1 && !loading2 && !loading3?
            
                <div className="flex m-4">
                    <div className="flex flex-col align-center justify-content bg-gray-700 text-lg text-white mt-12 h-3/6 overflow-auto no-scrollbar w-4/12  mb-4 shadow-xl ml-auto" >
                        <h1 className="text-xl ">Test</h1>
                        
                                <div className="flex p-2 space-between">
                                    <table className="m-4" >
                                        <thead>
                                            <tr>
                                                <th>Rank</th>
                                                <th>Name</th>
                                                <th>Country</th>
                                                <th>Rating</th>
                                            </tr>

                                        </thead>
                                        <tbody>
                                        {batsman1.rank.map(element =>{
                                            return(
                                            <tr>
                                                <td className="text-lg ml-auto">{element.rank}</td>
                                                <td className="text-lg mx-2">{element.name}</td>
                                                <td className="text-lg mx-2">{element.country}</td>
                                                <td className="text-lg mr-auto">{element.rating}</td>
                                            </tr>
                                            )})}
                                        </tbody>
                                    </table>
                                   
                                </div>


                      
                     

                    </div>

                    <div className="bg-gray-700 text-lg text-white mt-12 h-3/6 overflow-auto no-scrollbar w-4/12 ml-8 mb-4 shadow-xl">
                        <h1 className="ml-40 text-xl">ODI</h1>
                        
                
                        {batsman2.rank.map(element =>{
                            return(

                                <div className="flex p-2 space-between">
                                    <span className="text-lg mx-2">{element.rank}</span>
                                    <span className="text-lg mx-2">{element.name}</span>
                                    <span className="text-lg mx-2">{element.country}</span>
                                    <span className="text-lg mx-2">{element.rating}</span>
                                </div>


                            )
                        })}
                     

                    </div>

                    <div className="bg-gray-700 text-lg text-white mt-12 h-3/6 overflow-auto no-scrollbar w-4/12 ml-8 mb-4 shadow-xl mr-auto">
                        <h1 className="ml-40 text-xl">T20I</h1>
                        
                
                        {batsman3.rank.map(element =>{
                            return(

                                <div className="flex p-2 space-between">
                                    <span className="text-lg mx-2">{element.rank}</span>
                                    <span className="text-lg mx-2">{element.name}</span>
                                    <span className="text-lg mx-2">{element.country}</span>
                                    <span className="text-lg mx-2">{element.rating}</span>
                                </div>


                            )
                        })}
                     

                    </div>
                </div>
                
                :<></>}

        </div>
    )

}

export default Rankings
